    "# **Bellabeat Case Study**\n",
    "\n",
    "# About the company\n",
    "\n",
    "Bellabeat is a high-tech manufacturer of health-focused products for women. Bellabeat is a successful company, but stakeholders are aiming to grow larger by reaching out to new customers. They plan to analyze data tracked from FitBits (smart watches) and gain insights on how they can advertise properly and have the highest return on investment.\n",
    "\n",
    "# Questions to be answered\n",
    "* What are some trends in smart device usage?\n",
    "* How could these trends apply to Bellabeat customers?\n",
    "* How could these trends help influence Bellabeat marketing strategy\n",
    "\n",
    "# The data being analyzed\n",
    "For this analysis, CCO Urška Sršen pointed to a public dataset availabe on Kaggle. [FitBit Ftiness Tracker Data]('https://www.kaggle.com/arashnic/fitbit') (Made available through [Mobius]('https://www.kaggle.com/arashnic')) contains personal fitness tracker information from thirty fitbit users who consented to the submission of personal tracker data, including minute-level output for physical activity, heart rate, and sleep monitoring. It includes\n",
    "information about daily activity, steps, and heart rate that can be used to explore users’ habits.\n",
    "\n",
    "\n",
    "# Loading packages and Datasets"
   ]
  },
