   "source": [
    "There is a LOT of information as the data was reported daily. The main information here is the **Activity throughout the day**, **Sleep information** and **Steps taken**.\n",
    "\n",
    "\n",
    "# Normalizing the data\n",
    "\n",
    "As you may notice, these three data frames are separeted from each other but are related to the same women (referred as Id) and timestamps.\n",
    "\n",
    "To work with the data from the three different sources at the same time, it is better if they can all be merged into a single dataset. To do that, some aspects of the data must be normalized."
   ]
  },
  {
   "cell_type": "code",
   "execution_count": 3,
   "id": "259375a1",
   "metadata": {
    "_cell_guid": "72e7d9cc-f925-4a95-abd5-3afeec63ded2",
    "_uuid": "f2ba5667-3c05-4517-8698-524a0e0f5499",
    "collapsed": false,
    "execution": {
     "iopub.execute_input": "2023-09-11T16:19:43.698670Z",
     "iopub.status.busy": "2023-09-11T16:19:43.697087Z",
     "iopub.status.idle": "2023-09-11T16:19:43.879002Z",
     "shell.execute_reply": "2023-09-11T16:19:43.877180Z"
    },
    "jupyter": {
     "outputs_hidden": false
    },
    "papermill": {
     "duration": 0.194395,
     "end_time": "2023-09-11T16:19:43.882116",
     "exception": false,
     "start_time": "2023-09-11T16:19:43.687721",
     "status": "completed"
    },
    "tags": []
   },
   "outputs": [],
   "source": [
    "activity <- activity %>% \n",
    "  rename(date = ActivityDate) %>% \n",
    "  mutate(date = as_date(date, format= \"%m/%d/%Y\")) \n",
    "activity <- clean_names(activity)\n",
    "\n",
    "sleep <- sleep %>% \n",
    "  rename(date = SleepDay) %>% \n",
    "  mutate(date = as_date(date, format= \"%m/%d/%Y %I:%M:%S %p\"))\n",
    "sleep <- clean_names(sleep)\n",
    "\n",
    "steps <- steps %>% \n",
    "  rename(date = ActivityDay) %>% \n",
    "  mutate(date = as_date(date, format= \"%m/%d/%Y\"))\n",
    "steps <- clean_names(steps)"
   ]
  },
  {
   "cell_type": "markdown",
