     "start_time": "2023-09-11T16:19:43.889287",
     "status": "completed"
    },
    "tags": []
   },
   "source": [
    "These codelines have converted so that all three data sources have matching date formats and corresponding naming conventions.\n",
    "\n",
    "# Working with the data\n",
    "Firstly, I want to join all the tables together. This can be done using the id and dates as references to know who is who and where the different data is related to the same individual."
   ]
  },
  {
   "cell_type": "code",
   "execution_count": 4,
   "id": "6800c6ee",
   "metadata": {
    "_cell_guid": "126f6699-4c05-4db5-b084-1d92b9b74b90",
    "_uuid": "5f129566-0364-4719-83fa-aa447666f228",
    "collapsed": false,
    "execution": {
     "iopub.execute_input": "2023-09-11T16:19:43.914313Z",
     "iopub.status.busy": "2023-09-11T16:19:43.912760Z",
     "iopub.status.idle": "2023-09-11T16:19:43.945862Z",
     "shell.execute_reply": "2023-09-11T16:19:43.944010Z"
    },
    "jupyter": {
     "outputs_hidden": false
    },
    "papermill": {
     "duration": 0.045329,
     "end_time": "2023-09-11T16:19:43.949124",
     "exception": false,
     "start_time": "2023-09-11T16:19:43.903795",
     "status": "completed"
    },
    "tags": []
   },
   "outputs": [],
   "source": [
    "merged_df <- merge(x=activity, y=sleep, by=c(\"id\", \"date\"))\n",
    "merged_df <- merge(x=merged_df, y=steps, by=c(\"id\", \"date\"))"
   ]
  },
