     "exception": false,
     "start_time": "2023-09-11T16:19:44.123560",
     "status": "completed"
    },
    "tags": []
   },
   "source": [
    "As you can see, the average steps taken is 8541, about 85% from the recommended 10000 steps per day.\n",
    "\n",
    "More interesting is that if you look at the minutes spent being sedentary (no movement) it accounts for almost half of the day (11.8 hours) even though only about 7 of those hours are spent sleeping (average).\n",
    "\n",
    "\n",
    "One point worth looking into is the **very_active_minutes** data, as doing some high intensity exercise for a couple minutes every day can represent a great increase in health and happiness."
   ]
  },
