  {
   "cell_type": "markdown",
   "id": "5d0548c6",
   "metadata": {
    "_cell_guid": "99b1c7e1-a5d6-4ded-bff7-8bb5a42cea56",
    "_uuid": "4976aa9b-082e-474b-8193-37fd9938d447",
    "papermill": {
     "duration": 0.007705,
     "end_time": "2023-09-11T16:19:44.189392",
     "exception": false,
     "start_time": "2023-09-11T16:19:44.181687",
     "status": "completed"
    },
    "tags": []
   },
   "source": [
    "So on average 25 minutes are spent on high activity. Taking this into account I will arbitrary set a bar on the average + 10 minutes to classify women as above average in being very active throughout the day.\n",
    "\n",
    "### Adding columns"
   ]
  },
  {
   "cell_type": "code",
   "execution_count": 8,
   "id": "9a351404",
   "metadata": {
    "_cell_guid": "31aa2b83-c6fe-4266-a50a-9256ac6733da",
    "_uuid": "ca82da5b-0ac8-440e-bd94-5816b31ec46b",
    "collapsed": false,
    "execution": {
     "iopub.execute_input": "2023-09-11T16:19:44.209608Z",
     "iopub.status.busy": "2023-09-11T16:19:44.208005Z",
     "iopub.status.idle": "2023-09-11T16:19:44.228652Z",
     "shell.execute_reply": "2023-09-11T16:19:44.226848Z"
    },
    "jupyter": {
     "outputs_hidden": false
    },
    "papermill": {
     "duration": 0.03392,
     "end_time": "2023-09-11T16:19:44.231849",
     "exception": false,
     "start_time": "2023-09-11T16:19:44.197929",
     "status": "completed"
    },
    "tags": []
   },
   "outputs": [],
   "source": [
    "mean_very_active <- mean(merged_df$very_active_minutes) + 10\n",
    "merged_df <- merged_df %>% \n",
    "  mutate(above_avg = if_else(very_active_minutes > mean_very_active, \"TRUE\", \"FALSE\"))"
   ]
  },
  {
   "cell_type": "markdown",
   "id": "9844e30f",
   "metadata": {
    "_cell_guid": "6535b276-183f-460a-8620-3615713569bd",
    "_uuid": "85f6d15b-9dca-43eb-a9ab-71f39d9bc90f",
    "papermill": {
     "duration": 0.007759,
     "end_time": "2023-09-11T16:19:44.247458",
     "exception": false,
     "start_time": "2023-09-11T16:19:44.239699",
     "status": "completed"
    },
    "tags": []
   },
   "source": [
    "This code has now used the 35 minutes (average + 10) of very active minutes to classify the women on **above_avg**. Being either **TRUE** for the ones above or **FALSE** for the other ones.\n",
    "\n",
    "Another information I would like to have accounted for on the dataframe is the total time doing some activity (no matter the intensity). To do this we just need to add every minute being active and add as an extra column."
   ]
  },
  {
   "cell_type": "code",
   "execution_count": 9,
   "id": "e7fe345d",
   "metadata": {
    "_cell_guid": "93ad9e3e-f3fe-49af-9924-96e6ca5e51bc",
    "_uuid": "fb9a29b1-6cf9-4cb5-a2a8-3cc12b24c890",
    "collapsed": false,
    "execution": {
     "iopub.execute_input": "2023-09-11T16:19:44.267220Z",
     "iopub.status.busy": "2023-09-11T16:19:44.265589Z",
     "iopub.status.idle": "2023-09-11T16:19:44.283500Z",
     "shell.execute_reply": "2023-09-11T16:19:44.281656Z"
    },
    "jupyter": {
     "outputs_hidden": false
    },
    "papermill": {
     "duration": 0.030906,
     "end_time": "2023-09-11T16:19:44.286145",
     "exception": false,
     "start_time": "2023-09-11T16:19:44.255239",
     "status": "completed"
    },
    "tags": []
   },
   "outputs": [],
   "source": [
    "merged_df <- merged_df %>% \n",
    "  mutate(sum_active = (very_active_minutes + fairly_active_minutes + lightly_active_minutes))"
   ]
  },
