   "source": [
    "Here we can clearly see the relationship between taking more steps and burning more calories (obviously), but the interesting insight is to look at the blue points in the chart. As we have labelled the subjects on being above or below on very active minutes, here they are divided by colours.\n",
    "\n",
    "The blue points (above average) are mostly above the orange points (below average) both on steps taken and calories burnt.\n",
    "This could mean that having a period of high activity every day could help to burn more calories even when taking less overall steps. This is still a correlation and does not mean that one causes the other, specially when considering that only 30 women are being analyzed.\n",
    "\n",
    "Another thing we noticed was that on average, the subjects spend half the day without movement but only 7 hours sleeping."
   ]
