    "ggplot(merged_df, aes(x=sum_active, total_distance))+\n",
    "  geom_point(aes(color=above_avg))+\n",
    "  labs(title=\"Total distance VS Active time\", x=\"Active minutes\", y=\"Total distance (KM)\")+\n",
    "  geom_smooth(formula = y ~ x, method=\"loess\")"
   ]
