   "source": [
    "Of course having more active minutes would result in a greater travel distance, what is interesting to see here is that the women who have more time being very active (blue points) achieve a much higher travel distance even when they don't have as many active hours in a day. This means that having a higher intensity period during the day could mean achieving more in less time, specially useful for women who have a busy schedule.\n",
    "\n",
    "# Reliability of results\n",
    "\n",
    "Keep in mind that all the insights gained from these experiments are a correlation and not necessarily a causation relationship. Specially with a sample size of only 30 women among the millions of Fitbit users. In order to determine if one event actually leads to the another, further research and data would be required.\n",
    "\n",
    "# Business Recommendations\n",
    "\n",
    "Women who are interested in Bellabeat products are most likely to want two things: **Losing weight** and **looking better**. Everyone knows that the way to lose weight is burning more calories than you eat. According to the analysis of this dataset, women who have more minutes of high activity tend to burn more calories while exercising for a shorter period of time.\n",
    "\n",
    "With this insight, Bellabeat can opt to create a marketing campaign focusing on having a high-intensity workout, specially for busy women. Customers who were attracted by the products and followed that tip would likely see better results and be satisfied with the purchase.\n",
    "\n",
    "The other trend found is that sleeping time and sedentary time are closely related. As sleep is much needed in order to have a nice and healthy appearance, Bellabeat products could have a certain focus on improving sleeping schedules with things like reminders and nighttime modes.\n",
    "\n",
    "### In short:\n",
    "*Marketing campaigns focusing on the idea that to lose weight, it is probably a good idea to have a time for high-intensity movement.\n",
    "*Implementation and advertising of sleep-inducing features to reduce sedentary time through the day, improving active hours.\n",
    "\n",
    "\n",
    "\n",
    "\n",
    "## **Wrap Up**\n",
    "**Thank you** for reading through my Bellabeat case Study!\n",
